import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';
import './NavBar.css';
// import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
// import FormControl from '@mui/material/FormControl';
import { Select } from '@mui/material';
import Snackbar from '@mui/material/Snackbar';
import CloseIcon from '@material-ui/icons/Close'
import IconButton from '@mui/material/IconButton';
import { useState } from 'react';


function NavBar(props){

    const [format, setFormat] = useState("hex");
    const [open, setOpen] = useState(false);

    function handleChange(event){
        setFormat(event.target.value);
        setOpen(true);
        // alert(event.target.value)
        props.handleChanges(event.target.value)
        // console.log();
    }
    function closeBar(){
        setOpen(false);
    }
    return (
        <header className="navbarr">
            <div className="logo">
             {/* eslint-disable-next-line */}
                <a href="#">ColorPicker</a>
            </div>
            <div className='container'>
                <span>Level:{props.lev}</span>
            </div>
            <div className='slider'>
            <Slider 
            defaultValue={props.lev}
            min={200} 
            max={900} 
            step={100} 
            onAfterChange={props.changeColor}/>
            </div>
            <div className='select-cont'>
                <Select value={format} onChange={handleChange}>
                    <MenuItem value="hex">Hex- #ffffff</MenuItem>
                    <MenuItem value="rgb">RGB - rgb(255,255,255)</MenuItem>
                    <MenuItem value="rgba">RGBA - rgba(255,255,255,1.0)</MenuItem>
                    {/* <MenuItem value="no hash">no Hash - ffffff</MenuItem> */}
                </Select>
            </div>
            <Snackbar anchorOrigin={{vertical:"bottom", horizontal:"left"}} 
            open={open}
            autoHideDuration={3000}
            message={<span id="message-id">Format Changed to '{format}'</span>}
            ContentProps={{
                "aria-describedby": "message-id"
            }}
            onClose={closeBar}
            action={[
                <IconButton onClick={closeBar}
                 color="inherit"
                 key='close'
                 aria-label='close'
                 >
                    <CloseIcon />
                </IconButton>
            ]}/>
        </header>
    )
}

export default NavBar;
